import React from "react";
import { useLocation, useNavigate } from "react-router-dom";

const UserProfile = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { Data, departmentDetails } = location.state;
  const handleLogout = () => {
    navigate("/");
  };

  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
      }}
    >
      <h2>User Profile</h2>
      <button className="logoutButton" onClick={handleLogout}>
        Logout
      </button>

      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          width: "100%",
        }}
      >
        <div
          style={{
            borderRight: "1px solid #3498db", // Vertical line styling
            paddingRight: "20px", // Adjust padding for spacing
          }}
        >
          <img
            src={Data.photo_url}
            height="150px"
            width="150px"
            alt="User"
            style={{ borderRadius: "50%", border: "2px solid #3498db" }}
          />
          <div style={{ marginLeft: "20px" }}>
            <p>
              <strong>Roll Number:</strong> {Data.roll_number}
            </p>
            <p>
              <strong>Student Name:</strong> {Data.student_name}
            </p>
            <p>
              <strong>Email id:</strong> {Data.email_id}
            </p>
          </div>
        </div>
        <div style={{ marginLeft: "20px" }}>
          <p>
            <strong>Address:</strong> {Data.address}
          </p>
          <p>
            <strong>Contact Number:</strong> {Data.contact_number}
          </p>
          <p>
            <strong>School of Study:</strong> {Data.school_of_study}
          </p>
          <p>
            <strong>Year of Admission:</strong> {Data.year_of_admission}
          </p>
        </div>
      </div>

      <hr style={{ margin: "20px 0" }} />

      <h3>No Due Details:</h3>
      {departmentDetails && departmentDetails.length > 0 ? (
        <div
          style={{ display: "flex", textAlign: "center", alignItems: "center" }}
        >
          <div style={{ marginRight: "20px" }}>
            <p>
              <strong>Department:</strong>
            </p>
            <div style={{ marginRight: "20px" }}>
              <p>
                <strong>Status:</strong>
              </p>
            </div>
          </div>

          {departmentDetails.map((detail, index) => (
            <div key={index} style={{ marginRight: "20px" }}>
              <p>{detail.department_name}</p>
              <p>{detail.status}</p>
            </div>
          ))}
        </div>
      ) : (
        <p>No department details available.</p>
      )}
    </div>
  );
};

export default UserProfile;
